{{Infobox dungeon |name = Pinwheel Forest |image = [[File:Pinwheel Forest.png|300px]] |caption = A map of Pinwheel Forest. |tokens = 356,500 |location = Before Unova Route 3 }} '''Pinwheel Forest''' is a [[Dungeons|dungeon]] in [[Unova]]. It initially has 81 tiles arranged in an 9x9 square, including 9 chest tiles, 21 non-boss encounter tiles, and 1 boss encounter tile.
